import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Tabs,
  Tab,
  TextField,
  MenuItem,
  Grid,
  Paper,
} from '@mui/material';

const QuantitativeTrading = () => {
  const [activeTab, setActiveTab] = useState(0);
  const [accountBalance, setAccountBalance] = useState(0);
  const [vipLevel, setVipLevel] = useState('VIP 1');

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue);
  };

  useEffect(() => {
    if (accountBalance >= 5000) {
      setVipLevel('VIP 3');
    } else if (accountBalance >= 1000) {
      setVipLevel('VIP 2');
    } else {
      setVipLevel('VIP 1');
    }
  }, [accountBalance]);

  const overviewData = [
    { label: 'Yesterday Income', value: '20.59 USDT' },
    { label: 'Today’s Income', value: '5.59 USDT' },
    { label: 'Total Income', value: '500.59 USDT' },
  ];

  return (
    <Box p={2}>
      <Typography variant="h4" gutterBottom>
        Quantitative Trading
      </Typography>

      <Tabs value={activeTab} onChange={handleTabChange} textColor="primary" indicatorColor="primary">
        <Tab label="Overview" />
        <Tab label="History" />
      </Tabs>

      {activeTab === 0 && (
        <Box mt={4}>
          <Grid container spacing={3}>
            {overviewData.map((item, index) => (
              <Grid item xs={12} sm={4} key={index}>
                <Paper elevation={3} sx={{ p: 2, textAlign: 'center' }}>
                  <Typography variant="subtitle1">{item.label}</Typography>
                  <Typography variant="h6" color="primary">{item.value}</Typography>
                </Paper>
              </Grid>
            ))}
          </Grid>

          <Box mt={4} display="flex" gap={2} flexWrap="wrap">
            <TextField
              label="Account Balance"
              type="number"
              value={accountBalance}
              onChange={(e) => setAccountBalance(parseFloat(e.target.value) || 0)}
              fullWidth
            />

            <TextField
              label="VIP Level"
              value={vipLevel}
              select
              fullWidth
            >
              <MenuItem value="VIP 1">VIP 1</MenuItem>
              <MenuItem value="VIP 2">VIP 2</MenuItem>
              <MenuItem value="VIP 3">VIP 3</MenuItem>
            </TextField>
          </Box>
        </Box>
      )}

      {activeTab === 1 && (
        <Box mt={4}>
          <Typography variant="body1">History data will be shown here.</Typography>
        </Box>
      )}
    </Box>
  );
};

export default QuantitativeTrading;
